  false,\n\t\"url\": null,\n\t\"notes\": \"These files are geographic attribute data
  for New York State (NYS) Agricultural District Boundaries for each county. They
  are Arc 8.3 export files, in polygon format, derived from the scanned version of
  New York State (NYS) Agricultural District boundaries. Original maps were individual
  districts drafted at a scale of 1:24,000. The ArcInfo files are any districts within
  a NYS county boundary. The data depict private land areas placed in a district under
  the protection of NYS Agricultural District Law.\",\n\t\"license_title\": null,\n\t\"extras\":
